          <div className="backs">
            <Link to="/Lang">
              <img src={Tap} alt="" />
            </Link>
          </div>
        </div>

        <div class="center-bottom-text">Touch to start your refill process</div>
      </div> */}
    </div>
  );
};

export default Home;
